import IconDone from "./IconDone";

export default (props) => {
    const {
        item,
        itemNumber
    } = props;
    let itemStatus = React.createRef();
    return (
        <div style={{
            display: 'flex',
            flexDirection: 'row',
            justifyContent: 'space-between',
            alignItems: 'center'
        }} key={itemNumber.toString()}>
            <h1>{itemNumber + 1}) </h1>
            <h3>{item.description}</h3>
            <button onClick={() => props.deleteItem(itemNumber)}>Done</button>
            <button onClick={() => props.deleteItem(itemNumber)}>Delete</button>
        </div>
    )
}
